import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import pic1 from "../images/right.webp"; // ✅ Correct Path

import "../styles/Home.css"; // CSS file agar alag use karni ho

const Home = () => {
  return (
    <div className="container mt-4">
      <div className="row">
        {/* Left Column */}
        <div className="col-md-6 d-flex flex-column justify-content-center p-4">
          <h1>Home Services at Your Doorstep</h1>
          <p>What are you looking for?</p>

          <div className="service-box">
            <img src="https://cdn-icons-png.flaticon.com/512/2867/2867281.png" alt="Salon" />
            <span>Women's Salon & Spa</span>
          </div>

          <div className="service-box">
            <img src="https://cdn-icons-png.flaticon.com/512/2867/2867316.png" alt="AC Repair" />
            <span>AC & Appliance Repair</span>
          </div>

          <div className="service-box">
            <img src="https://cdn-icons-png.flaticon.com/512/2867/2867294.png" alt="Cleaning" />
            <span>Cleaning Services</span>
          </div>
        </div>

        {/* Right Column (Image) */}
        <div className="col-md-6">
          <img
            src={pic1}
            alt="Home Services"
            className="img-fluid rounded"
          />
        </div>
      </div>
    </div>
  );
};

export default Home;
